import react, { useState } from "react";
import Card from "../UI/Card";
import ExpensesFilter from "../UI/ExpensesFilter";
import ExpenseItem from "./ExpenseItem";
import "./NewExpenseComponent.css";

function Expense(props) {
  const [selectedYear, setSelectedYear] = useState("2020");

  const getYearHandler = (year) => {
    setSelectedYear(year);
  };

  return (
    <div>
      <Card className="expenses">
        <ExpensesFilter getYear={getYearHandler} def={selectedYear} />
        {
          /* {props.data.map((expense) => (
          <ExpenseItem
            key={expense.id}
            title={expense.title}
            amount={expense.amount}
            date={expense.date}
          />
        ))} */
          props.data
            .filter((filtExpense) => {
              return filtExpense.date.getFullYear() === selectedYear;
            })
            .map((expense) => (
              <ExpenseItem
                key={expense.id}
                title={expense.title}
                amount={expense.amount}
                date={expense.date}
              />
            ))
        }
      </Card>
    </div>
  );
}
export default Expense;
